import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
})

const Login = () => (
  <View style={styles.container}>
    <Text>LOGIN ASOSOFT</Text>
  </View>
)
export default Login
